<!doctype html>
<html ng-app="parkMtApp" ng-cloak>
  <head>
    <title>Park MT</title>
    <style>

			#custom-handle {
		    width: 5em;
		    height: 1.6em;
		    top: 50%;
		    margin-top: -.8em;
		    text-align: center;
		    line-height: 1.6em;
	  	}

    </style>
		<link rel="stylesheet" href="//code.jquery.com/ui/1.12.1/themes/base/jquery-ui.css">
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <!--<link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/3.3.7/css/bootstrap.min.css">
    <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.1.1/jquery.min.js"></script>
    <script src="https://maxcdn.bootstrapcdn.com/bootstrap/3.3.7/js/bootstrap.min.js"></script>
    <script src="https://ajax.googleapis.com/ajax/libs/angularjs/1.4.9/angular.min.js"></script>-->
    <link rel="stylesheet" href="//code.jquery.com/ui/1.12.1/themes/base/jquery-ui.css">
		<script src="https://code.jquery.com/jquery-1.12.4.js"></script>
  	<script src="https://code.jquery.com/ui/1.12.1/jquery-ui.js"></script>
    <link rel="stylesheet" href="css/bootstrap.css">
    <link rel="stylesheet" href="css/projectlisting.css">
    <script src="js/bootstrap.min.js"></script>
    <script src="js/angular.js"></script>
    <script src="js/parkingctrl.js"></script>
    <div ng-include="'header.html'"></div>
		<script>
			$(document).ready(function(){
        $("#selectedDay").val(0);
        $("#selectedMap").val("building");
        $("#parking").hide();
        angular.element('#mainBody').scope().GrabJson("building");
				$( function() {
			    var handle = $( "#custom-handle" );
          //var currDate = new Date();
			    $( "#timeSlider" ).slider({
					value:0,
					min: 0,
					max: 23,
					step: 1,
			      create: function() {
			        handle.text( $( this ).slider( "value" ) );
			      },
			      slide: function( event, ui ) {
							var currHour = ui.value%12;
							var timeSec = "";
							$("#sliderVal").val(currHour);
              var selectedDay = $("#selectedDay").val();
							angular.element('#mainBody').scope().RefreshDensityMap(ui.value,selectedDay,$("#selectedMap").val());

							if(currHour == 0){
								currHour = 12;
							}
							if(ui.value < 12)
								timeSec ="AM";
							else
								timeSec ="PM";

			        handle.text(currHour + ": 00 "+timeSec);
			      }
			    });
				handle.text("12:00 AM");
			  } );
			});
		</script>
  </head>
	<body id="mainBody" ng-controller="parkingCtrl">
		<div class="container-fluid">
      <div class="row">
			  <div class="col-lg-12">
          <div class="btn-group">
            <button class="btn btn-success" id="buildBtn" ng-click="SelectMap('building')">Buildings</button>
            <button class="btn btn-primary" id="parkBtn" ng-click="SelectMap('parking')">Parking</button>
            <inpyt id="selectedMap" type="hidden" value="building"/>
          </div>
        </div>
      <div class="row">
			  <div class="col-lg-12">
          <div class="btn-group">
            <button class="btn btn-success" id="monBtn" ng-click="SelectDay(0,'monBtn','building')">Monday</button>
            <button class="btn btn-primary" id="tuesBtn" ng-click="SelectDay(1,'tuesBtn','building')">Tuesday</button>
            <button class="btn btn-primary" id="wedBtn" ng-click="SelectDay(2,'wedBtn','building')">Wednesday</button>
            <button class="btn btn-primary" id="thurBtn" ng-click="SelectDay(3,'thurBtn','building')">Thursday</button>
            <button class="btn btn-primary" id="friBtn" ng-click="SelectDay(4,'friBtn','building')">Friday</button>
            <inpyt id="selectedDay" type="hidden" value="0"/>
          </div>
        </div>
      </div>
      <div class="row">
        <div class="col-lg-6">
          <div id="timeSlider"  align="center">
            <div id="custom-handle" class="ui-slider-handle"></div>
          </div>
          <input type="hidden" id="sliderVal" "/>
        </div>
        <div class="col-lg-6"></div>
      </div>
